import heapq


def main():
    A, B, K = map(int, input().split())
    smaller = []
    larger = []
    for i in range(A, B+1):
        if len(smaller) < K:
            heapq.heappush(smaller, i)
        else:
            heapq.heappushpop(smaller, i)
        if len(larger) < K:
            heapq.heappush(larger, -i)
        else:
            heapq.heappushpop(larger, -i)
    for i in range(K):
        print(smaller[i])
    for i in range(K):
        print(-larger[i])


if __name__ == '__main__':
    main()

