import sys

a, b, k = list(map(int, sys.stdin.readline().split()))

numbers = list(range(a, b+1))

def partition(A, p, r):
    x = A[r]
    i = p - 1
    for j in range(p, r):
        if A[j] <= x:
            i += 1
            A[i], A[j] = A[j], A[i]
    A[i+1], A[r] = A[r], A[i+1]
    return i+1

def select(A, p, r, i):
    if p == r:
        return A[p]
    q = partition(A, p, r)
    k = q - p + 1
    if i == k:
        return A[q]
    elif i < k:
        return select(A, p, q-1, i)
    else:
        return select(A, q+1, r, i-k)

